import React from 'react'

const SearchBox = ({ searchChange }) => {
    return (

        <div className='pa2'>
            <input
                className='pa2 ba b--pink bg-washed-red'
                type="search"
                placeholder='Search Robots'
                onChange={searchChange}
            />
        </div>
    )
}

export default SearchBox;
